__author__ = 'bkurniawan'from rl.agent.eligibility_traces_cql_2d1 import EligibilityTracesCQL2D1Agentfrom .. import rl_utilsimport mathclass EligibilityTracesCQL2D2Agent(EligibilityTracesCQL2D1Agent):    ### A modified coarse Q-learning agent    def __init__(self, params_filename=None):        super(EligibilityTracesCQL2D2Agent, self).__init__()
    def is_terminal(self, state):        print('2d2 is_terminal')        R, ata, aa = rl_utils.get_R_ata_aa_from_state(state)        return R >= 131 or math.fabs(ata) > 90 or math.fabs(aa) > 60    def get_reward(self, state):        if self.is_in_goal(state):            return 1 if self.consecutive_in_goal >= rl_utils.MIN_NUM_IN_GOAL else 0.1        else:            return 0                